const Input = () => (
<>
    <div>
    <textarea rows="10" cols="60" id = "txtArea"> </textarea>
    </div>
    <div>
    <input type = "button" value="click here" onclick = "getText();" />
    </div>
</>
);
function getText() {
  var area = document.getElementById("txtArea");
  var str = area.value // here we got value
  alert(str + " i did it");
}
export default Input;
